import React from 'react';
import { Card , Button, CardBody} from 'reactstrap';
import { withNamespaces } from "react-i18next";

const Start = ({onQuestionStart}) => {
    return(
            <Card body className="text-center">

                    <div>
                    <h1>Start Exam</h1>
                    <Button color="primary" className="btn btn-primary waves-effect waves-light mx-2" onClick={onQuestionStart}>
                        Start
                    </Button>
                    </div>


            </Card>
    )
}

export default withNamespaces()(Start)
